import "./App.css";
import MenuNav from "./components/landing/MenuNav";
import logo_kalypse from "./uploads_k/logo_kalypse.png";
import Main from "./components/landing/Main";
// import LaMarque from "./components/landing/LaMarque";
import ModalApp from "./components/landing/video/ModalApp";

function App() {
  return (
    <>
      <div className="container-fluid principal">
        <div className="row">
          <div className=" col-lg-2 contenedor">
            <img id="logo_Main_Bar" src={logo_kalypse} alt="Logo" />
            <MenuNav />
          </div>
          <div className="col-lg-10 contenedor">
            {/* <LaMarque /> */}
            <Main />
            <ModalApp />
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
